import ManageOrder from "../container/Login/Login";
import Dashboard from "../container/Dashboard/Dashboard";

const publicRouter = [
    {path: 'restaurant/', component: Dashboard},
    {path: 'restaurant/login', component: ManageOrder},
]

const privateRouter = [
    {}
]

export {publicRouter, privateRouter};
